// fuckComponent.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const fuckComponent = () => {
    const [Fucks, setfucks] = useState([]);

    useEffect(() => {
        axios.get('/api/fucks')
            .then(response => {
                setfucks(response.data);
            })
            .catch(error => {
                console.error('Error fetching fucks:', error);
            });
    }, []);

    return (
        <div>
            <h1>fuck</h1>
            <ul>
                {fuck.map(fuck => (
                    <li key={fuck.id}>{fuck.name}</li>
                ))}
            </ul>
        </div>
    );
}

export default fuckComponent;
